insert  into `tbl_consulta`(`codigo`,`id_plano`,`tabla_destino`,`estado`,`descripcion`,`prioridad`,`sentencia`,`sentencia_alterna`,`criterio_sel`,`criterio`,`consecutivo`,`campo_consecutivo`,`consecutivo_b`,`campo_consecutivo_b`,`top`,`top_tabla`,`desde_items`,`hasta_items`,`id_plan`,`truncate`,`drop_table`,`group_by`,`orderBy`,`orderType`,`buscar_campo`,`created_at`,`updated_at`) values (1,1,'tbl_ws_cliente',0,'Consulta informacion de clientes',0,'SET QUOTED_IDENTIFIER OFF; \r\nSELECT TOP @top \r\n	ISNULL(REPLACE(f200_nit, \"-\", \"\"),\"\") as codCliente\r\n	,ISNULL(f200_nombres+\" \"+f200_apellido1+\" \"+f200_apellido2,\"\") as nomCliente\r\n	,ISNULL(f015_direccion1,\"\") as Direccion\r\n	,case when len(isnull(f015_celular,\"0\")) &lt; 10 then ISNULL(f015_telefono,\"\") else ISNULL(f015_celular,\"\") end as Telefono\r\n	,ISNULL(\"770\"+f015_id_depto+f015_id_ciudad,\"\") as codCiudadCliente\r\n	,ISNULL(REPLACE(f200_nit, \"-\", \"\"),\"\") as nit\r\n	,ISNULL(f015_contacto,\"\") as nomContacto\r\n	,ISNULL(1,\"\") as CodTipoCliente\r\n	,ISNULL(f207_id_plan_criterios,\"\") as CodSubtradeCategory\r\n	,ISNULL(f210_id,\"\") AS CodVendedor\r\n	,FORMAT(t350_co_docto_contable.f350_fecha,\"yyyy/MM/dd\", \"en-us\") AS CodDiaVisita\r\n	,ISNULL(f5791_ind_frecuencia,\"\") as CodFrecuencia\r\n	,ISNULL(\"770\"+f015_id_depto+f015_id_ciudad,\"\") as CodCiudadBodega\r\n	,ISNULL(1,\"\") as CodTipoRuta\r\n	,ISNULL(f350_consec_docto,\"\") as consecutivo_factura\r\n\r\nFROM t350_co_docto_contable 	\r\n	INNER JOIN t461_cm_docto_factura_venta ON t350_co_docto_contable.f350_rowid = t461_cm_docto_factura_venta.f461_rowid_docto and t350_co_docto_contable.f350_id_cia = t461_cm_docto_factura_venta.f461_id_cia 	\r\n	INNER JOIN t470_cm_movto_invent ON t461_cm_docto_factura_venta.f461_rowid_docto = t470_cm_movto_invent.f470_rowid_docto_fact and t461_cm_docto_factura_venta.f461_id_cia = t470_cm_movto_invent.f470_id_cia 	\r\n	INNER JOIN t201_mm_clientes ON (f461_rowid_tercero_fact = f201_rowid_tercero AND f461_id_sucursal_fact = f201_id_sucursal and f461_id_cia = f201_id_cia) 	\r\n	INNER JOIN t200_mm_terceros ON f200_rowid = f201_rowid_tercero and f200_id_cia = f201_id_cia 	\r\n	INNER JOIN t207_mm_criterios_clientes ON f207_rowid_tercero = f201_rowid_tercero and f207_id_sucursal = f201_id_sucursal and f207_id_cia = f201_id_cia\r\n	INNER JOIN t121_mc_items_extensiones ON f121_rowid = f470_rowid_item_ext and f121_id_cia = f470_id_cia	\r\n	INNER JOIN t120_mc_items ON t120_mc_items.f120_rowid = f121_rowid_item and f120_id_cia = f121_id_cia      	\r\n	INNER JOIN t124_mc_items_referencias ON f124_rowid_item = f120_rowid and f124_id_cia =  f120_id_cia	\r\n	INNER JOIN t125_mc_items_criterios ON f125_rowid_item = f120_rowid and f125_id_cia = f120_id_cia 	\r\n	INNER JOIN t015_mm_contactos on f015_rowid = f201_rowid_contacto and f015_id_cia = f201_id_cia\r\n	INNER JOIN t210_mm_vendedores ON f461_rowid_tercero_vendedor = f210_rowid_tercero and f461_id_cia = f210_id_cia\r\n	INNER JOIN t5791_sm_ruta_frecuencia on f5791_rowid_tercero = f200_rowid and f200_id_cia = @Cia\r\n\r\nWHERE RIGHT(\"\"+CAST(f120_id AS VARCHAR(20)),20) &lt;&gt; \"\" 	\r\n	and t350_co_docto_contable.f350_id_tipo_docto = \"@tipoDoc\" \r\n	and t350_co_docto_contable.f350_consec_docto >= @conseDoc	\r\n	and t350_co_docto_contable.f350_id_cia = @Cia 	\r\n	and LTRIM(RTRIM(f125_id_criterio_mayor)) = \"@idCriterio\" \r\n	and f200_ind_estado = @idEstado\r\n	and f201_ind_estado_activo = @idEstadoActivo\r\n	and f201_id_cond_pago is not null \r\n	and t350_co_docto_contable.f350_id_sucursal is not null \r\n	and f124_referencia &lt; &gt; RIGHT(\"\"+CAST(f120_id AS VARCHAR(20)),20)\r\n	and f124_referencia LIKE \"FA%\"\r\n	and t350_co_docto_contable.f350_fecha &gt;= \"2022-03-01\" -- fecha inicio\r\n	and t350_co_docto_contable.f350_fecha &lt;= \"2022-03-31\" -- fecha fin\r\n\r\nGROUP BY f200_nit,f200_nombres,f350_fecha,f350_consec_docto,f200_apellido1,f200_apellido2,f015_direccion1,f015_celular,f015_telefono,f015_id_depto,f015_id_ciudad,f015_contacto,f210_id,f5791_ind_frecuencia,f207_id_plan_criterios\r\nORDER BY f350_consec_docto ASC \r\n\r\nSET QUOTED_IDENTIFIER ON;',NULL,0,'043',1,'consecutivo_factura',NULL,NULL,5000,1,NULL,NULL,'002',0,1,NULL,'consecutivo_factura','asc',NULL,NULL,'2022-03-02 03:05:48'),(2,2,'tbl_ws_detalle_venta',0,'Consulta informacion detalle ventas',0,'SET QUOTED_IDENTIFIER OFF; \r\nSELECT TOP @top \r\n	ISNULL(f350_consec_docto,\"\") AS DocNumero\r\n	,ISNULL(CAST(f124_referencia AS VARCHAR(20)),\"\") AS CodProducto\r\n	,ISNULL(f120_descripcion,\"\") AS Descripcion\r\n	,f470_cant_base as Cantidad	\r\n	,ISNULL(f470_vlr_bruto+f470_vlr_imp, \"\") as Precio	\r\n	,ISNULL(f120_rowid,\"\") as consecutivo_item\r\n\r\nFROM t350_co_docto_contable \r\n	INNER JOIN t461_cm_docto_factura_venta ON t350_co_docto_contable.f350_rowid = t461_cm_docto_factura_venta.f461_rowid_docto and t350_co_docto_contable.f350_id_cia = t461_cm_docto_factura_venta.f461_id_cia 	\r\n	INNER JOIN t470_cm_movto_invent ON t461_cm_docto_factura_venta.f461_rowid_docto = t470_cm_movto_invent.f470_rowid_docto_fact and t461_cm_docto_factura_venta.f461_id_cia = t470_cm_movto_invent.f470_id_cia 	\r\n	INNER JOIN t201_mm_clientes ON (f461_rowid_tercero_fact = f201_rowid_tercero AND f461_id_sucursal_fact = f201_id_sucursal and f461_id_cia = f201_id_cia) 	\r\n	INNER JOIN t200_mm_terceros ON f200_rowid = f201_rowid_tercero and f200_id_cia = f201_id_cia 	\r\n	INNER JOIN t207_mm_criterios_clientes ON f207_rowid_tercero = f201_rowid_tercero and f207_id_cia = f201_id_cia\r\n	INNER JOIN t121_mc_items_extensiones ON f121_rowid = f470_rowid_item_ext and f121_id_cia = f470_id_cia	\r\n	INNER JOIN t120_mc_items ON t120_mc_items.f120_rowid = f121_rowid_item and f120_id_cia = f121_id_cia\r\n	INNER JOIN t124_mc_items_referencias ON f124_rowid_item = f120_rowid and f124_id_cia =  f120_id_cia	\r\n	INNER JOIN t125_mc_items_criterios ON f125_rowid_item = f120_rowid and f125_id_cia = f120_id_cia 	\r\n	\r\nWHERE RIGHT(\"\"+CAST(f120_id AS VARCHAR(20)),20) &lt;&gt; \"\" 	\r\n	and t350_co_docto_contable.f350_id_tipo_docto = \"@tipoDoc\"\r\n	and t350_co_docto_contable.f350_consec_docto >= @conseDoc\r\n	and t120_mc_items.f120_rowid &gt; @conseItem \r\n	and t350_co_docto_contable.f350_id_cia = @Cia 	\r\n	and LTRIM(RTRIM(f125_id_criterio_mayor)) = \"@idCriterio\" \r\n	and f200_ind_estado = @idEstado\r\n	and f201_ind_estado_activo = @idEstadoActivo\r\n	and f201_id_cond_pago is not null \r\n	and t350_co_docto_contable.f350_id_sucursal is not null \r\n	and f124_referencia &lt; &gt; RIGHT(\"\"+CAST(f120_id AS VARCHAR(20)),20)\r\n	and f124_referencia LIKE \"FA%\"\r\n	and t350_co_docto_contable.f350_fecha &gt;= \"2022-03-01\" -- fecha inicio\r\n	and t350_co_docto_contable.f350_fecha &lt;= \"2022-03-31\" -- fecha fin\r\n\r\nGROUP BY f350_consec_docto,f124_referencia,f120_descripcion,f470_cant_base,f470_vlr_bruto,f470_vlr_imp,f120_rowid\r\nORDER BY f350_consec_docto ASC\r\n\r\nSET QUOTED_IDENTIFIER ON;','SET QUOTED_IDENTIFIER OFF; \r\nSELECT TOP @top \r\n	ISNULL(f350_consec_docto,\"\") AS DocNumero\r\n	,ISNULL(CAST(f124_referencia AS VARCHAR(20)),\"\") AS CodProducto\r\n	,ISNULL(f120_descripcion,\"\") AS Descripcion\r\n	,f470_cant_base as Cantidad	\r\n	,ISNULL(f470_vlr_bruto+f470_vlr_imp, \"\") as Precio	\r\n	,ISNULL(f120_rowid,\"\") as consecutivo_item\r\n\r\nFROM t350_co_docto_contable \r\n	INNER JOIN t461_cm_docto_factura_venta ON t350_co_docto_contable.f350_rowid = t461_cm_docto_factura_venta.f461_rowid_docto and t350_co_docto_contable.f350_id_cia = t461_cm_docto_factura_venta.f461_id_cia 	\r\n	INNER JOIN t470_cm_movto_invent ON t461_cm_docto_factura_venta.f461_rowid_docto = t470_cm_movto_invent.f470_rowid_docto_fact and t461_cm_docto_factura_venta.f461_id_cia = t470_cm_movto_invent.f470_id_cia 	\r\n	INNER JOIN t201_mm_clientes ON (f461_rowid_tercero_fact = f201_rowid_tercero AND f461_id_sucursal_fact = f201_id_sucursal and f461_id_cia = f201_id_cia) 	\r\n	INNER JOIN t200_mm_terceros ON f200_rowid 