/* Procedure structure for procedure `tbl_ws_consulta` */

/*!50003 DROP PROCEDURE IF EXISTS  `tbl_ws_consulta` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `tbl_ws_consulta`()
BEGIN
		SELECT consecutivo_factura FROM tbl_ws_cliente GROUP BY consecutivo_factura;
		SELECT DocNumero FROM tbl_ws_total_facturado GROUP BY DocNumero;
		SELECT DocNumero FROM tbl_ws_detalle_venta GROUP BY DocNumero;
		SELECT consecutivo_factura FROM tbl_ws_inventario GROUP BY consecutivo_factura;
		SELECT consecutivo_factura FROM tbl_ws_vendedor GROUP BY consecutivo_factura;
	END */$$
DELIMITER ;

/* Procedure structure for procedure `tbl_ws_refresh_planoRegistro_0` */

/*!50003 DROP PROCEDURE IF EXISTS  `tbl_ws_refresh_planoRegistro_0` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`integracion_ecom`@`%` PROCEDURE `tbl_ws_refresh_planoRegistro_0`()
BEGIN
		UPDATE tbl_ws_cliente SET planoRegistro = 0 WHERE codigo > 0;
		UPDATE tbl_ws_detalle_venta SET planoRegistro = 0 WHERE codigo > 0;
		UPDATE tbl_ws_inventario SET planoRegistro = 0 WHERE codigo > 0;
		UPDATE tbl_ws_total_facturado SET planoRegistro = 0 WHERE codigo > 0;
		UPDATE tbl_ws_vendedor SET planoRegistro = 0 WHERE codigo > 0;
	END */$$
DELIMITER ;

